def parse(source):
	spl = source.split('\n')
	obj = json.loads(spl[0])
	addr = list()
	for a in spl[1].split(';'):
		addr.append(a.split('->'))

	for a in addr:
		print(get_value(a, obj))
	return

def get_value(address, map):
	res = map
	for key in address:
		res = res[key]
	return res


